function str2utf8(str) {
    return eval('\''+encodeURI(str).replace(/%/gm, '')+'\'').toLowerCase();
}

function showtext(text){
    var d = dialog({
        content: "<span class='nnt'>"+text+"</span>",
        quickClose: true
    });
    d.showModal();
    setTimeout(function(){
        d.close()
    },1000)
}

function showmodaltext(text){
    var d = dialog({
        content: text
    });
    d.showModal();
    return d
}

function timeStamp2String(){
    var datetime = new Date();
    var year = datetime.getFullYear();
    var month = datetime.getMonth() + 1 < 10 ? "0" + (datetime.getMonth() + 1) : datetime.getMonth() + 1;
    var date = datetime.getDate() < 10 ? "0" + datetime.getDate() : datetime.getDate();
    var hour = datetime.getHours()< 10 ? "0" + datetime.getHours() : datetime.getHours();
    var minute = datetime.getMinutes()< 10 ? "0" + datetime.getMinutes() : datetime.getMinutes();
    var second = datetime.getSeconds()< 10 ? "0" + datetime.getSeconds() : datetime.getSeconds();
    return year + "-" + month + "-" + date+" "+hour+":"+minute+":"+second;
}

function getByteLen(val) {
    var len = 0;
    for (var i = 0; i < val.length; i++) {
      var a= val.charAt(i);
      if (a.match(/[^\x00-\xff]/ig) != null) {
        len += 2;
      }else {
        len += 1;
      }
    }
    return len;
}

function HEX2DEC(hex){
    return parseInt(hex,16).toString();
}
function HEX2RGB(hex){
    hex = hex.substring(1);
    if(hex.length === 3){
       hex += hex;
    }
    return [HEX2DEC(hex.substring(0,2)),HEX2DEC(hex.substring(2,4)),HEX2DEC(hex.substring(4))];
}

function RGB2Hex(r,g,b) {
    var hex = "#" + ((1 << 24) + (r << 16) + (g << 8) + b).toString(16).slice(1);
    return hex;
}

function countSubstr(str, substr, isIgnore) {
	var count;
	var reg = "";
    substr2 = substr.replaceAll('\/','\\/')
    console.log(substr2)
	if (isIgnore == true) {
		reg = "/" + substr2 + "/gi";
	} else {
		reg = "/" + substr2 + "/g";
	}
	reg = eval(reg);
	if (str.match(reg) == null) {
		count = 0;
	} else {
		count = str.match(reg).length;
	}
	return count;
}

