        editForm.append($('<h3 style="text-align:center;margin-bottom:5px">出错了</h3>'))
        editForm.append($('<h6 style="text-align:center;margin-bottom:10px">浏览器版本过低，无法正常使用MixIO平台，请您更新至最新版的Chrome、Edge、Firefox或Safari浏览器。</h6>'))
